  return (
    <div>
      <h2>{title}</h2>
      <p>Released: {release}</p>
      <p>Genre: {genre}</p>
      <p>Director: {director}</p>
      <p>Actor: {actor}</p>
      <p>Plot: {plot}</p>
    </div>
  );
}
